import Farmacias from '../../components/Farmacias/Farmacias';
import Juegomesa from '../../components/Farmacias/Juegomesa/Juegomesa';
import Airbnb from '../../components/Airbnb/Airbnb';
import Telefonia from '../../components/Telefonia/Telefonia';
import Formulario from '../../components/Formulario/Formulario';
import Hbomax from '../../components/Hbomax/hbomax';
import Botwhap from '../../components/Botwhap/Botwhap';
export default function Uxui() {
  return (
    <div className="container my-3">
      <h1 className="titulo2 my-3 mx-3">UX/UI Research</h1>
      <Jueg />
      <Farmacias />
      <Airbnb />
      <Telefonia />
      <div className="row my-3 mx-3">
        <h1 className="titulo2">UX/UI Design</h1>
      </div>
      <Formulario />
      <Hbomax />
      <Botwhap />
      <div className="container-fluid"></div>
    </div>
  );
}
